import React from "react";

const ImageDisplay = (props) => {
  return (
    <div className="imageDisplay f3 dark-red b center pt5">
      {props.url.length > 0 ? (
        <img src={props.url} alt="Invalid image" />
      ) : (
        <div></div>
      )}
      ;
    </div>
  );
};
export default ImageDisplay;
